import React from 'react';
import PropTypes from 'prop-types';



const MDBIcon = ({icon}) => {
        return (
                // <i className={icon} />
                <i far className="font-weight-bold blue-text mr-2 mt-1" icon="thumbs-down"/>
        );
};


MDBIcon.defaultProps = {
    icon: 'fa fa-commenting-o fa-lg',
};


MDBIcon.propTypes = {
    icon: PropTypes.string.isRequired
};

export default MDBIcon;
